    // AppLovin requires mraid.open() to be always available for validation
    var mraid = window.mraid || {};
    var mraidReady = false;
    var mraidVersion = null;
    var mraidPlacementType = null;

    // Create fallback mraid.open() function that will be used if MRAID doesn't provide one
    function createMraidOpenFallback() {
      return function(url) {
        // Fallback implementation if MRAID is not available
        console.log('MRAID.open() called (fallback):', url);
        if (url) {
          window.open(url, '_blank');
        }
      };
    }

    // Ensure mraid.open() is always available for validation compliance
    // This is required by AppLovin validation - must be available immediately
    if (!mraid.open) {
      mraid.open = createMraidOpenFallback();
    }

    // Also ensure window.mraid.open exists if window.mraid is defined
    if (typeof window.mraid !== 'undefined' && !window.mraid.open) {
      window.mraid.open = createMraidOpenFallback();
    }

    function initMRAID() {
      if (typeof window.mraid !== 'undefined') {
        // Use the real MRAID object
        mraid = window.mraid;

        // MRAID 3.0: Check version if available
        if (typeof mraid.getVersion === 'function') {
          try {
            mraidVersion = mraid.getVersion();
            console.log('MRAID version:', mraidVersion);
          } catch (e) {
            console.log('Could not get MRAID version:', e);
          }
        }

        // MRAID 3.0: Check placement type if available
        if (typeof mraid.getPlacementType === 'function') {
          try {
            mraidPlacementType = mraid.getPlacementType();
            console.log('MRAID placement type:', mraidPlacementType);
          } catch (e) {
            console.log('Could not get MRAID placement type:', e);
          }
        }

        // MRAID 3.0: Check feature support if available
        if (typeof mraid.getSupports === 'function') {
          try {
            var supports = mraid.getSupports();
            console.log('MRAID supports:', supports);
          } catch (e) {
            console.log('Could not get MRAID supports:', e);
          }
        }

        // Ensure mraid.open is always available (required by AppLovin validation)
        // Some MRAID implementations may not have open method
        if (!mraid.open) {
          mraid.open = createMraidOpenFallback();
        }

        // Listen for MRAID ready event (MRAID 2.0/3.0)
        if (mraid.addEventListener) {
          mraid.addEventListener('ready', onMRAIDReady);
          // Listen for viewable changes to control audio (MRAID 2.0/3.0)
          mraid.addEventListener('viewableChange', onViewableChange);
          
          // MRAID 3.0: Listen for error events if available
          if (mraidVersion && parseFloat(mraidVersion) >= 3.0) {
            if (typeof mraid.addEventListener === 'function') {
              mraid.addEventListener('error', onMRAIDError);
            }
          }
        }

        // Check if MRAID is already ready
        try {
          var state = mraid.getState();
          if (state === 'loading') {
            // MRAID is still loading, wait for ready event
          } else if (state === 'default' || state === 'expanded' || state === 'resized') {
            // MRAID is ready
            onMRAIDReady();
          }
        } catch (e) {
          // MRAID not available or error occurred
          console.log('MRAID not available, proceeding without MRAID');
          onMRAIDReady();
        }
      } else {
        // MRAID not available, proceed normally
        console.log('MRAID not found, proceeding without MRAID');
        onMRAIDReady();
      }
    }

    function onMRAIDReady() {
      mraidReady = true;
      console.log('MRAID ready, starting application');
      // Start the app initialization after MRAID is ready
      startApp();
    }

    function onMRAIDError(error) {
      // MRAID 3.0: Handle error events
      console.error('MRAID error:', error);
      // Continue execution even if MRAID error occurs
    }

    function onViewableChange(viewable) {
      console.log('MRAID viewable changed:', viewable);
      if (!viewable) {
        // Pause audio when ad is not viewable
        const backgroundMusic = document.getElementById('backgroundMusic');
        if (backgroundMusic && !backgroundMusic.paused) {
          backgroundMusic.pause();
          console.log('Background music paused due to ad not viewable');
        }
      } else if (hasUserInteracted && !isIOSMuted) {
        // Resume audio when ad becomes viewable again (if user has interacted and not muted)
        const backgroundMusic = document.getElementById('backgroundMusic');
        if (backgroundMusic && backgroundMusic.paused) {
          backgroundMusic.play().catch(error => {
            console.log('Could not resume audio:', error);
          });
        }
      }
    }

    // Fix viewport height for mobile browsers
    function updateVH() {
      let vh = window.innerHeight * 0.01;
      document.documentElement.style.setProperty('--vh', `${vh}px`);
    }
    window.addEventListener('resize', updateVH);
    updateVH();

    // Performance monitoring and early device detection
    let lastFrameTime = performance.now();
    let frameCount = 0;
    let lowPerformanceMode = false;
    let isLowEndDevice = false;

    // Early device detection for low-end devices (before animations start)
    function detectLowEndDevice() {
      // Check hardware concurrency (CPU cores)
      const cores = navigator.hardwareConcurrency || 2;
      
      // Check device memory (if available)
      const memory = navigator.deviceMemory || 4; // Default to 4GB if not available
      
      // Check screen resolution (low resolution often indicates low-end device)
      const screenWidth = window.screen.width;
      const screenHeight = window.screen.height;
      const isSmallScreen = screenWidth <= 480 || screenHeight <= 480;
      
      // Check user agent
      const ua = navigator.userAgent.toLowerCase();
      const isIOSDevice = /iphone|ipad|ipod/.test(ua);
      const iosMatch = /os (\d+)_/.exec(ua);
      const iosMajorVersion = iosMatch ? parseInt(iosMatch[1], 10) : null;
      const isLegacyIOS = isIOSDevice && iosMajorVersion !== null && iosMajorVersion < 11;
      const isLowEndUA = /android.*(2\.|3\.|4\.0|4\.1|4\.2|4\.3)/.test(ua) || isLegacyIOS;

      // Modern iOS devices should start in full-quality mode and rely on runtime FPS checks
      if (isIOSDevice && !isLegacyIOS) {
        isLowEndDevice = false;
        return isLowEndDevice;
      }

      // Determine if device is low-end (non-iOS or very old iOS)
      isLowEndDevice = (cores <= 2) || (memory <= 2) || isSmallScreen || isLowEndUA;
      
      if (isLowEndDevice) {
        console.log('Low-end device detected - enabling performance optimizations');
        enableLowPerformanceMode();
      }
      
      return isLowEndDevice;
    }

    // Check performance and adjust accordingly
    function checkPerformance() {
      const now = performance.now();
      const delta = now - lastFrameTime;
      frameCount++;

      if (frameCount >= 10) {
        const fps = 1000 / (delta / frameCount);
        if (fps < 30 && !lowPerformanceMode) {
          enableLowPerformanceMode();
        }
        frameCount = 0;
      }
      lastFrameTime = now;
      
      // Throttle performance monitoring on low-end devices
      const delay = lowPerformanceMode ? 2 : 1;
      setTimeout(() => requestAnimationFrame(checkPerformance), delay);
    }

    function enableLowPerformanceMode() {
      if (lowPerformanceMode) return; // Already enabled
      
      lowPerformanceMode = true;
      document.body.classList.add('low-performance');
      
      // Add ultra-low class for very low-end devices
      if (isLowEndDevice) {
        document.body.classList.add('ultra-low');
      }
      
      // Reduce number of particles and animations
      window.numSparkles = 6; // Reduced from 8
      window.animationDuration = 1;
      
      // Disable expensive animations
      const placeholderImages = document.querySelectorAll('.placeholder-image.active');
      placeholderImages.forEach(img => {
        // Reduce animation complexity
        img.style.animationDuration = '2s'; // Slower, less CPU intensive
      });
      
      // Reduce carousel animation speed
      const carousels = document.querySelectorAll('.carousel-track');
      carousels.forEach(track => {
        track.style.animationDuration = '30s'; // Slower scroll
      });
      
      console.log('Low-performance mode enabled' + (isLowEndDevice ? ' (ultra-low)' : ''));
    }

    // Detect device capabilities early
    detectLowEndDevice();

    // Start performance monitoring (throttled for low-end devices)
    if (!isLowEndDevice) {
      requestAnimationFrame(checkPerformance);
    } else {
      // Less frequent monitoring for low-end devices
      setInterval(() => {
        if (frameCount > 0) {
          const fps = 1000 / ((performance.now() - lastFrameTime) / frameCount);
          if (fps < 25) {
            enableLowPerformanceMode();
          }
          frameCount = 0;
          lastFrameTime = performance.now();
        }
      }, 2000);
    }

    // Optimize asset loading
    function preloadAssets() {
      const images = Object.values(base64Assets);
      images.forEach(src => {
        const img = new Image();
        img.src = src;
      });
    }

    // Main application start function
    function startApp() {
      try {
        preloadAssets();
        initCarousel();

        // Start with title screen instead of going directly to gameplay
        showTitleScreen();
      } catch (error) {
        console.error('Initialization error:', error);
        // Fallback to simple state if initialization fails
        const fallbackImage = base64Assets.VENUE_ICON || base64Assets.VENUE_ICON_BASE64 || Object.values(base64Assets)[0] || '';
        document.body.innerHTML = '<div style="display:flex;justify-content:center;align-items:center;height:100vh"><img src="' + fallbackImage + '" style="width:150px;height:150px;"></div>';
      }
    }

    // Initialize on load with MRAID compliance
    window.addEventListener("load", () => {
      initMRAID();
    });

    // Carousel functionality - Dual Infinite Scroll with 3x Duplication
    function initCarousel() {
      console.log('Initializing dual carousel system...');
      
      // Get all available carousel images (all three rows)
      const topCarouselImages = document.querySelectorAll('.carousel-image');
      const middleCarouselImages = document.querySelectorAll('.carousel-image-2');
      const thirdCarouselImages = document.querySelectorAll('.carousel-image-3');
      const allCarouselImages = [...topCarouselImages, ...middleCarouselImages, ...thirdCarouselImages];
      
      console.log(`Top carousel images found: ${topCarouselImages.length}`);
      console.log(`Middle carousel images found: ${middleCarouselImages.length}`);

    function initSingleCarouselWithImages(trackSelector, imageSet) {
      const carouselTrack = document.querySelector(trackSelector);
      if (!carouselTrack) {
        console.log(`Track not found: ${trackSelector}`);
        return;
      }
      
      console.log(`Initializing ${trackSelector} with ${imageSet.length} images`);
      
      // Clear the track
      carouselTrack.innerHTML = '';
      
      // Create infinite scroll effect by repeating the image set
      // This creates the illusion of infinite scrolling without visual repetition
      for (let set = 0; set < 3; set++) {
        imageSet.forEach((originalImg, index) => {
          const clonedImg = originalImg.cloneNode(true);
          
          // Ensure proper styling for carousel display
          clonedImg.className = 'carousel-image';
          clonedImg.style.opacity = '1';
          clonedImg.style.transform = 'none';
          clonedImg.style.width = '20vh';
          clonedImg.style.height = '20vh';
          clonedImg.style.borderRadius = '25%';
          clonedImg.style.objectFit = 'cover';
          
          carouselTrack.appendChild(clonedImg);
        });
      }
      
      console.log(`Created carousel with ${imageSet.length} unique images repeated 3 times for infinite scroll`);
      
      console.log(`Created ${carouselTrack.children.length} total images (3x duplication) for ${trackSelector}`);
      
      // Calculate the total width for debugging
      const totalWidth = carouselTrack.scrollWidth;
      const containerWidth = carouselTrack.parentElement.offsetWidth;
      console.log(`${trackSelector} - Carousel track width: ${totalWidth}px, Container width: ${containerWidth}px`);
      console.log(`${trackSelector} - Animation will move by: ${totalWidth / 3}px (one complete set)`);
    }

    // Simple audio handling for AppLovin compliance
    let hasUserInteracted = false;
    let isIOSMuted = false; // Track iOS mute switch state

    // Detect iOS mute switch state
    function checkIOSMuteState() {
      // iOS mute switch detection: try to play silent audio and check if it actually plays
      // This is the most reliable way to detect iOS mute switch on older iOS versions
      try {
        // Create a temporary audio context to check mute state
        var audioContext = new (window.AudioContext || window.webkitAudioContext)();
        
        // On iOS, if mute switch is on, audio context state will be 'suspended' or audio won't play
        // We can also check by attempting to play a silent sound
        var testAudio = new Audio('data:audio/wav;base64,UklGRnoGAABXQVZFZm10IBAAAAABAAEAQB8AAEAfAAABAAgAZGF0YQoGAACBhYqFbF1fdJivrJBhNjVgodDbq2EcBj+a2/LDciUFLIHO8tiJNwgZaLvt559NEAxQp+PwtmMcBjiR1/LMeSwFJHfH8N2QQAoUXrTp66hVFApGn+DyvmwhBSuBzvLZiTYIG2m98OSfTgwMUqfk8LZjHAY4kdfyzHksBSR3x/DdkEAKFF606euoVRQKRp/g8r5sIQUrgc7y2Yk2CBtpvfDkn04MDFKn5PC2YxwGOJHX8sx5LAUkd8fw3ZBAC');
        testAudio.volume = 0.01; // Very quiet
        testAudio.play().then(function() {
          // Audio played successfully, mute switch is off
          isIOSMuted = false;
          testAudio.pause();
          testAudio = null;
        }).catch(function() {
          // Audio failed to play, likely muted
          isIOSMuted = true;
        });
        
        // Also check AudioContext state
        if (audioContext.state === 'suspended') {
          // On iOS, suspended state often indicates mute switch is on
          // But we need to resume it first to be sure
          audioContext.resume().then(function() {
            if (audioContext.state === 'running') {
              isIOSMuted = false;
            } else {
              isIOSMuted = true;
            }
          }).catch(function() {
            isIOSMuted = true;
          });
        }
      } catch (e) {
        // If AudioContext is not available, assume not muted (fallback)
        console.log('AudioContext not available, assuming not muted');
        isIOSMuted = false;
      }
    }

    // Monitor iOS mute switch changes
    function setupIOSMuteMonitoring() {
      // Check initial state
      checkIOSMuteState();
      
      // Monitor for changes (iOS doesn't fire events, so we check periodically)
      // Also listen for visibility changes which can indicate mute state changes
      document.addEventListener('visibilitychange', function() {
        setTimeout(checkIOSMuteState, 100);
      });
      
      // Check periodically (iOS mute switch doesn't fire events)
      setInterval(checkIOSMuteState, 2000);
    }

    // Initialize iOS mute detection
    if (/iphone|ipad|ipod/.test(navigator.userAgent.toLowerCase())) {
      setupIOSMuteMonitoring();
    }

    async function playSound(soundElement) {
      try {
        if (!hasUserInteracted) {
          console.log('Waiting for user interaction before playing sound');
          return;
        }

        // Check iOS mute state before playing
        if (isIOSMuted) {
          console.log('iOS mute switch is on, skipping audio playback');
          return;
        }

        soundElement.currentTime = 0;
        soundElement.volume = 1.0; // Set volume to 100%
        await soundElement.play().catch(function(error) {
          // If play fails, might be due to mute switch
          if (/iphone|ipad|ipod/.test(navigator.userAgent.toLowerCase())) {
            console.log('Audio play failed, checking mute state');
            checkIOSMuteState();
          }
          throw error;
        });
      } catch (error) {
        console.error('Sound playback error:', error);
      }
    }

    // Start background music after user interaction
    async function startBackgroundMusic() {
      try {
        if (!hasUserInteracted) {
          console.log('Waiting for user interaction before starting background music');
          return;
        }

        // Check iOS mute state before playing
        if (isIOSMuted) {
          console.log('iOS mute switch is on, skipping background music');
          return;
        }

        const backgroundMusic = document.getElementById('backgroundMusic');
        backgroundMusic.volume = 1.0; // Set volume to 100%
        await playSound(backgroundMusic);
        console.log('Background music started after user interaction');
      } catch (error) {
        console.error('Error starting background music:', error);
      }
    }

    // Handle user interaction for audio
    function handleUserInteraction() {
      if (!hasUserInteracted) {
        hasUserInteracted = true;
        console.log('User interaction detected');
        startBackgroundMusic();
      }
    }

    // Add interaction listeners
    document.addEventListener('click', handleUserInteraction, { once: true });
    document.addEventListener('touchstart', handleUserInteraction, { once: true });

    // Optimize sparkle creation with performance modes
    function createSparkleExplosion() {
      // Use ultra-low config for very low-end devices
      const config = isLowEndDevice ? animationConfig.ultraLow :

                     animationConfig.normal;
      
      const container = document.createElement('div');

        sparkle.className = 'sparkle hardware-accelerated';
        
        // Calculate positions with reduced calculations
        const angle = (i / numSparkles) * Math.PI * 2;
        const distance = 150 + (i % 2) * 30; // Simplified variation
        
        const tx = Math.cos(angle) * distance;
        const ty = Math.sin(angle) * distance;
        sparkle.style.setProperty('--tx', `${tx}px`);
        sparkle.style.setProperty('--ty', `${ty}px`);
        
        // Simplified size calculation

        sparkle.style.animation = `sparkleAnim ${duration}s ease-out forwards`;
        
        addCleanupListeners(sparkle);
        fragment.appendChild(sparkle);
      }

      container.appendChild(fragment);
      setTimeout(() => container.remove(), 2400);
    }

          star.classList.add('fade-in');
        });
      }
      
      container.appendChild(fragment);
    }

    // Optimize image loading and error handling
    function loadImage(src, fallbackSrc) {
      return new Promise((resolve, reject) => {
        const img = new Image();
        img.onload = () => resolve(img);
        img.onerror = () => {
          if (fallbackSrc) {
            img.src = fallbackSrc;
            resolve(img);
          } else {
            reject(new Error(`Failed to load image: ${src}`));
          }
        };
        img.src = src;
      });
    }

      // Position the hand guide to attach properly to the target thumbnail
      const thumbnailRect = targetThumbnail.getBoundingClientRect();
      console.log(' Target thumbnail rect:', thumbnailRect);
      console.log(' Window dimensions:', { width: window.innerWidth, height: window.innerHeight });
      
      // Position hand lower and more to the right, starting from outside screen
      const screenCenterX = window.innerWidth * 0.7; // Move to 70% from left (more to the right)
      const screenCenterY = window.innerHeight * 0.8; // Move to 80% from top (much lower)
      
      // Calculate thumbnail center
      const thumbnailCenterX = thumbnailRect.left + thumbnailRect.width / 2;
      const thumbnailCenterY = thumbnailRect.top + thumbnailRect.height / 2;
      
      // Position hand lower, but offset to point at thumbnail
      const handOffsetX = (thumbnailCenterX - screenCenterX) * 0.2; // 20% towards thumbnail
      const handOffsetY = (thumbnailCenterY - screenCenterY) * 0.2; // 20% towards thumbnail
      
      const leftPercent = 70 + (handOffsetX / window.innerWidth * 100); // Start from 70% (right side)
      const topPercent = 73 + (handOffsetY / window.innerHeight * 100); // Start from 80% (lower)
      
      hand.style.left = `${leftPercent}%`;
      hand.style.top = `${topPercent}%`;
      hand.style.transform = 'translateX(-50%) rotate(-25deg)';
      
      console.log(' Hand attached to thumbnail at:', { 
        thumbnailCenter: { x: thumbnailCenterX, y: thumbnailCenterY },
        handPosition: { leftPercent, topPercent },
        offset: { x: handOffsetX, y: handOffsetY },
        finalPosition: { left: `${leftPercent}%`, top: `${topPercent}%` }
      });
      
      // Start animation
      setTimeout(() => {
        hand.classList.add('animate');
        console.log('Hand animation started');
        
        // Debug: Check if hand is visible
        setTimeout(() => {
          const computedStyle = window.getComputedStyle(hand);
          console.log(' Hand debug info:', {
            opacity: computedStyle.opacity,
            visibility: computedStyle.visibility,
            display: computedStyle.display,
            zIndex: computedStyle.zIndex,
            position: computedStyle.position,
            left: computedStyle.left,
            top: computedStyle.top,
            transform: computedStyle.transform,
            backgroundImage: computedStyle.backgroundImage
          });
        }, 500);
      }, 100);
      
      // Make hand guide follow thumbnail if it moves (for responsive layouts)
      const updateHandPosition = () => {
        const newThumbnailRect = targetThumbnail.getBoundingClientRect();
        const newScreenCenterX = window.innerWidth * 0.7; // Move to 70% from left (more to the right)
        const newScreenCenterY = window.innerHeight * 0.8; // Move to 80% from top (much lower)
        
        const newThumbnailCenterX = newThumbnailRect.left + newThumbnailRect.width / 2;
        const newThumbnailCenterY = newThumbnailRect.top + newThumbnailRect.height / 2;
        
        const newHandOffsetX = (newThumbnailCenterX - newScreenCenterX) * 0.2;
        const newHandOffsetY = (newThumbnailCenterY - newScreenCenterY) * 0.2;
        
        const newLeftPercent = 70 + (newHandOffsetX / window.innerWidth * 100);
        const newTopPercent = 73 + (newHandOffsetY / window.innerHeight * 100);
        
        hand.style.left = `${newLeftPercent}%`;
        hand.style.top = `${newTopPercent}%`;
        hand.style.transform = 'translateX(-50%) rotate(-25deg)';
      };
      
      // Update position on window resize
      window.addEventListener('resize', updateHandPosition);
      
      // Store the update function for cleanup
      hand._updatePosition = updateHandPosition;

      // Function to cleanup hand guide
      function removeHandGuide() {
        hand.classList.remove('animate');
        hand.classList.add('fade-out');
        
        // Remove resize listener
        if (hand._updatePosition) {
          window.removeEventListener('resize', hand._updatePosition);
        }
        
        // Remove hand after fade
        setTimeout(() => {
          if (hand && hand.parentElement) {
            hand.remove();
          }
          if (handContainer && handContainer.children.length === 0) {
            handContainer.remove();
          }
        }, 500);
      }

      // Add click listener to stop animation
      document.addEventListener('click', removeHandGuide, { once: true });
    }

    // Update the thumbnail creation function to call the hand guide with proper timing
    async function addNewThumbnails(items, category) {
      const fragment = document.createDocumentFragment();
      const startTime = performance.now();
      
      for (let i = 0; i < items.length; i++) {
        const wrapper = document.createElement("div");
        wrapper.className = `thumbnail-wrapper hardware-accelerated category-${category.toLowerCase().replace(/\s+/g, '-')}`;
        
        try {
          const thumb = await loadImage(
            getAssetUrl('THUMBNAIL', items[i].ID),
            "data:image/svg+xml;charset=utf-8,%3Csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 1 1'%3E%3C/svg%3E"
          );
          
          thumb.className = "thumbnail hardware-accelerated";
          thumb.addEventListener("click", () => handleThumbnailClick(items[i], category));
          
          wrapper.appendChild(thumb);
          fragment.appendChild(wrapper);
          
          // Check performance and adjust if needed
          if (performance.now() - startTime > 100 && !lowPerformanceMode) {
            enableLowPerformanceMode();
          }
          
          // Thumbnail appearance starts at 800ms as specified in timeline
          setTimeout(() => {
            wrapper.classList.add('fade-in');
            setTimeout(() => {
              thumb.classList.add('fade-in');
            }, 30); // Each thumbnail 30ms apart for smooth sequence
          }, 800 + (i * 30)); // Start at 800ms, then each thumbnail 30ms apart
        } catch (error) {
          console.error(`Failed to load thumbnail for ${items[i].ID}:`, error);
        }
      }

      uiPanel.innerHTML = "";
      uiPanel.appendChild(fragment);
      
      // Add hand guide for first category only, with a longer delay
      if (currentCategoryIndex === 0) {
        setTimeout(addHandGuide, 1200); // Increased delay to ensure thumbnails are rendered
      }
      
      setTimeout(() => {
        isTransitioning = false;
        cleanupUnusedElements();
      }, 500);
    }

    // Memory management
    function cleanupMemory() {
      cleanupUnusedElements();
      if (window.gc) window.gc();
    }

    // Periodic cleanup
    setInterval(cleanupMemory, 30000);

    // Optimize thumbnail click handler
    function handleThumbnailClick(item, category) {
      if (isTransitioning) return;
      
      playSound(boxOpenSound);

      // Remove hand guide if it exists
      const handContainer = document.querySelector('.hand-container');
      if (handContainer) {
        const hand = handContainer.querySelector('.hand-guide');
        if (hand) {
          hand.classList.remove('animate');
          hand.classList.add('fade-out');
          setTimeout(() => handContainer.remove(), 500);
        }
      }

      // Hide all placeholders for the current category with fade-out effect
      const currentCategory = categories[currentCategoryIndex];
      console.log(` Current category index: ${currentCategoryIndex}`);
      console.log(` Current category: "${currentCategory}"`);
      console.log(` All categories: [${categories.join(', ')}]`);
      
      const currentCategoryPlaceholders = overlayContainer.querySelectorAll(`.placeholder-image[data-category="${currentCategory}"]`);
      console.log(` Found ${currentCategoryPlaceholders.length} placeholders with data-category="${currentCategory}"`);
      
      // Also check for any placeholders without data-category attribute (fallback)
      const allPlaceholders = overlayContainer.querySelectorAll('.placeholder-image');
      console.log(` Total placeholders found: ${allPlaceholders.length}`);
      allPlaceholders.forEach((placeholder, index) => {
        const category = placeholder.getAttribute('data-category');
        console.log(` Placeholder ${index}: data-category="${category}"`);
      });
      
      currentCategoryPlaceholders.forEach(placeholder => {
        placeholder.classList.remove('fade-in', 'active');
        placeholder.classList.add('fade-out');
        // Remove placeholder after fade-out animation completes (300ms)
        setTimeout(() => placeholder.remove(), 300);
      });
      
      // Fallback: If no placeholders found with data-category, try to hide active placeholders
      if (currentCategoryPlaceholders.length === 0) {
        console.log(` No placeholders found with data-category, trying fallback method...`);
        const activePlaceholders = overlayContainer.querySelectorAll('.placeholder-image.active');
        console.log(` Found ${activePlaceholders.length} active placeholders as fallback`);
        activePlaceholders.forEach(placeholder => {
          placeholder.classList.remove('fade-in', 'active');
          placeholder.classList.add('fade-out');
          setTimeout(() => placeholder.remove(), 300);
        });
      }
      
      // Note: showAllPlaceholders() will be called by renderCategory() after this

      // Create wave effect for thumbnails
      const thumbnailWrappers = document.querySelectorAll('.thumbnail-wrapper');
      thumbnailWrappers.forEach((wrapper, index) => {
        setTimeout(() => {
          const thumb = wrapper.querySelector('.thumbnail');
          if (thumb) {
            thumb.classList.add('clicked');
          }
          wrapper.classList.add('fade-out');
        }, index * 50);
      });

      setTimeout(() => {
        selectedItems[category] = item;
        updateOverlay(item);
        currentCategoryIndex++;

        // Hide title bar after first selection (when currentCategoryIndex becomes 1)
        if (currentCategoryIndex === 1) {
          const title = document.querySelector('.main-title');
          const titleScreen = document.getElementById('titleScreen');
          
          // Add fade-out animation to title and title screen
          title.classList.add('fade-out');
          titleScreen.classList.add('fade-out');
          
          // Hide title screen after animation completes
          setTimeout(() => {
            titleScreen.classList.remove('active');
            titleScreen.classList.add('hidden');
          }, 600);
        }

        if (currentCategoryIndex < categories.length) {
          renderCategory();
        } else {
          // Show stars and final animation immediately after the last selection
          showStars();
        }
      }, 300);
    }

    function updateOverlay(item) {
      // Check if this is a _MULTIPLE asset
      const isMultipleAsset = item.FileName && item.FileName.some(fileName => fileName.includes('_MULTIPLE_'));
      
      if (isMultipleAsset) {
        console.log(` Processing _MULTIPLE asset: ${item.ID} with ${item.FileName.length} objects`);
        console.log(`   SubObjects: ${item.SubObjects ? item.SubObjects.join(', ') : 'None'}`);
        console.log(`   SubObjectsDistance: ${item.SubObjectsDistance ? item.SubObjectsDistance.join(', ') : 'None'}`);
        
        // Create overlay images for ALL objects in the _MULTIPLE asset
        item.FileName.forEach((fileName, index) => {
          const img = document.createElement("img");
          img.src = getAssetUrl('OBJECT', fileName);
          img.className = "overlay-image";
          
          // Use SubObjectsDistance if available, otherwise use main Distance
          let distance = item.Distance;
          if (item.SubObjectsDistance && item.SubObjectsDistance[index] !== undefined) {
            distance = item.SubObjectsDistance[index];
          }
          
          // Use dynamic Z-index from data.ZIndexMap if available
          let zIndex = Math.floor(10 + (20 - distance));
          if (data.ZIndexMap && data.ZIndexMap[item.Category]) {
            zIndex = data.ZIndexMap[item.Category] + 1; // Objects on top of placeholders
          }
          img.style.zIndex = zIndex;
          
          img.onerror = () => {
            console.error(`Failed to load object for ${fileName}`);
            img.src = "data:image/svg+xml;charset=utf-8,%3Csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 1 1'%3E%3C/svg%3E";
          };
          overlayContainer.appendChild(img);

          requestAnimationFrame(() => {
            img.classList.add('fade-in');
          });
        });
      } else {
        // Single object asset (original behavior)
        const img = document.createElement("img");
        img.src = getAssetUrl('OBJECT', item.FileName[0]);
        img.className = "overlay-image";
        
        // Use dynamic Z-index from data.ZIndexMap if available
        let zIndex = Math.floor(10 + (20 - item.Distance));
        if (data.ZIndexMap && data.ZIndexMap[item.Category]) {
          zIndex = data.ZIndexMap[item.Category] + 1; // Objects on top of placeholders
        }
        img.style.zIndex = zIndex;
        
        img.onerror = () => {
          console.error(`Failed to load object for ${item.FileName[0]}`);
          img.src = "data:image/svg+xml;charset=utf-8,%3Csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 1 1'%3E%3C/svg%3E";
        };
        overlayContainer.appendChild(img);

        requestAnimationFrame(() => {
          img.classList.add('fade-in');
        });
      }

      // Check if this is the last selection
      if (currentCategoryIndex >= categories.length - 1) {
        playSound(boxOpenSound);
      }
    }

    function finishFlow() {
      // This function is no longer needed as we handle the final screen in showStars
    }

    // Update click handler to use the entire final screen div with MRAID compliance
    // Always call mraid.open() as required by AppLovin validation
    // This must be called unconditionally for validation to pass
    const finalScreenElement = document.getElementById("finalScreen");
    if (finalScreenElement) {
      finalScreenElement.addEventListener("click", function() {
        const ua = navigator.userAgent.toLowerCase();
        let url;

        // Determine URL based on platform
        if (/iphone|ipad|ipod/.test(ua)) {
          url = 'https://apps.apple.com/gb/app/venue-relaxing-design-game/id6443802883';
        } else {
          url = 'https://play.google.com/store/apps/details?id=com.superbloomgames.atable&hl=en';
        }

        // Always call mraid.open() - this is required for AppLovin validation
        // Use window.mraid if available, otherwise use our local mraid variable
        // Both will have the open() method due to our initialization above
        var currentMraid = (typeof window.mraid !== 'undefined' && window.mraid) ? window.mraid : mraid;
        currentMraid.open(url);
      });
    } else {
      console.error('finalScreen element not found, cannot attach click handler');
    }

    // Optimize placeholder creation
    function createPlaceholder(category, items, isActive = false, isCompleted = false) {
      const placeholderKey = `BLANK_${category}`;
      if (base64Assets[placeholderKey]) {
        const placeholderImg = document.createElement("img");
        placeholderImg.src = base64Assets[placeholderKey];
        placeholderImg.className = "overlay-image placeholder-image hardware-accelerated";
        placeholderImg.setAttribute('data-category', category); // Add category tracking
        
        // Set z-index: all placeholders should be visible, active ones on top
        let zIndex = 1000 + Math.floor(10 + (20 - items[0].Distance));
        if (data.ZIndexMap && data.ZIndexMap[category]) {
          zIndex = data.ZIndexMap[category] - 1; // Placeholders below objects
        }
        
        // All placeholders get the same base z-index to ensure visibility
        placeholderImg.style.zIndex = zIndex;
        console.log(` Set z-index ${zIndex} for placeholder: ${category}`);
        
        // Add active class for bouncing animation only for current category
        if (isActive) {
          placeholderImg.classList.add('active');
        }
        
        overlayContainer.appendChild(placeholderImg);
        console.log(` Created placeholder for ${category}: isActive=${isActive}, isCompleted=${isCompleted}`);
        
        // All placeholders start visible without animation
        requestAnimationFrame(() => {
          placeholderImg.classList.add('fade-in');
          console.log(` Added fade-in to placeholder: ${category}`);
          
          // Only the active placeholder gets animation (bounce + glow)
          if (isActive) {
            // Delay the active animation to avoid initial bouncing
            setTimeout(() => {
              placeholderImg.classList.add('active');
              console.log(` Added active class to placeholder: ${category}`);
            }, 100);
          }
        });
      }
    }

    // Title Screen Function
    function showTitleScreen() {
      console.log('Showing title screen');
      document.getElementById('titleScreen').classList.add('active');
      document.getElementById('titleScreen').classList.remove('hidden');
      
      // Auto-transition to gameplay after 500ms (title in animation)
      setTimeout(() => {
        startGameplay();
      }, 500);
    }

    function startGameplay() {
      console.log('Starting gameplay flow...');
      currentCategoryIndex = 0;
      
      // Don't fade out title yet - keep it visible during first gameplay sequence
      // Title will disappear after first item selection in handleThumbnailClick
      
      // Start gameplay immediately
      renderCategory();
    }

    // Update placeholder states without recreating them
    function updatePlaceholderStates() {
      console.log(` Updating placeholder states for currentCategoryIndex: ${currentCategoryIndex}`);
      
      const allPlaceholders = overlayContainer.querySelectorAll('.placeholder-image');
      allPlaceholders.forEach((placeholder, index) => {
        const category = placeholder.getAttribute('data-category');
        const categoryIndex = categories.indexOf(category);
        
        if (categoryIndex === -1) return;
        
        const isActive = (categoryIndex === currentCategoryIndex);
        const isCompleted = (categoryIndex < currentCategoryIndex);
        
        console.log(` Updating placeholder ${category}: isActive=${isActive}, isCompleted=${isCompleted}`);
        
        // Remove all animation classes
        placeholder.classList.remove('active', 'fade-in', 'fade-out');
        
        if (isCompleted) {
          // Completed placeholders should be hidden
          placeholder.classList.add('fade-out');
          setTimeout(() => placeholder.remove(), 300);
        } else if (isActive) {
          // Active placeholder gets full animation (bounce + glow)
          placeholder.classList.add('fade-in', 'active');
          console.log(` Set ${category} to active`);
        } else {
          // Future placeholders stay visible but static
          placeholder.classList.add('fade-in');
        }
      });
    }


    // Show all placeholders for the current gameplay state
    function showAllPlaceholders() {
      console.log(` Showing all placeholders for currentCategoryIndex: ${currentCategoryIndex}`);
      
      // Clear existing placeholders
      const existingPlaceholders = overlayContainer.querySelectorAll('.placeholder-image');
      existingPlaceholders.forEach(placeholder => placeholder.remove());
      
      // Show ALL placeholders at the beginning, then hide them progressively
      for (let i = 0; i < categories.length; i++) {
        const cat = categories[i];
        const catItems = grouped[cat];
        if (catItems && catItems.length > 0) {
          // Only the current category should have bouncing animation
          const isActive = (i === currentCategoryIndex);
          // Hide placeholders for categories that have already been selected
          const isCompleted = (i < currentCategoryIndex);
          console.log(` Category ${i} (${cat}): isActive=${isActive}, isCompleted=${isCompleted}`);
          createPlaceholder(cat, catItems, isActive, isCompleted);
        }
      }
    }

    // Optimize category rendering
    function renderCategory() {
      if (isTransitioning) return;
      isTransitioning = true;

      const category = categories[currentCategoryIndex];
      const items = grouped[category];

      // Show all placeholders with only current category having bouncing animation
      if (currentCategoryIndex === 0) {
        // First category: create all placeholders
        showAllPlaceholders();
      } else {
        // Subsequent categories: update existing placeholders
        updatePlaceholderStates();
      }

      // Fade out existing thumbnails if not first category
      if (currentCategoryIndex > 0) {
        const existingThumbs = document.querySelectorAll('.thumbnail');
        existingThumbs.forEach(thumb => {
          thumb.classList.add('fade-out');
          setTimeout(() => thumb.remove(), 300);
        });
      }

      // Add new thumbnails with category
      setTimeout(() => addNewThumbnails(items, category), 100);
    }

    function showStars() {
      // Create flow effect
      const flowEffect = document.createElement('div');
      flowEffect.className = 'flow-effect hardware-accelerated';
      document.body.appendChild(flowEffect);
      
      // Show and animate bar glow first
      const barGlow = document.getElementById('barGlowEffect');
      barGlow.style.display = 'block';
      requestAnimationFrame(() => {
        barGlow.style.animation = 'barGlowSlide 2s ease-in-out forwards';
      });
      
      // Create sparkle explosion with delayed sound
      setTimeout(() => {
        createSparkleExplosion();
        // Delay the sparkle sound by 150ms after the explosion starts
        setTimeout(() => {
          const sparkleSound = document.getElementById('sparkleSound');
          playSound(sparkleSound);
        }, 150);
      }, 400);

      // Create and show stars with slight delay
      setTimeout(() => {
        const container = document.createElement('div');
        container.className = 'star-container hardware-accelerated';
        document.body.appendChild(container);
        createStars(container);
      }, 400);

      // Trigger final transition
      setTimeout(handleFinalTransition, 2000);

      // Clean up effects
      setTimeout(() => {
        flowEffect.remove();
        barGlow.style.display = 'none';
        barGlow.style.animation = 'none';
      }, 1500);
    }

    function handleFinalTransition() {
      // Show final screen
      uiPanel.style.display = "none";
      
      // Play reveal sound
      const revealSound = document.getElementById('revealSound');
      playSound(revealSound);
      
      // First set display to flex
      finalScreen.style.display = "flex";
      
      // Force reflow to ensure the transition works
      finalScreen.offsetWidth;
      
      // Add the fade-in class in the next frame to ensure the transition starts
      requestAnimationFrame(() => {
        finalScreen.classList.add('fade-in');
      });
    }</script>
